import { useState } from "react";
import OutputList from "./OutputList";
import React from 'react';


const Prediction = () => {
  const [prediction, setPrediction] = useState([
    {title: "Prediction Steps", id: 0}
    //{ title: 'My new website', body: 'lorem ipsum...', author: 'mario', id: 1 },
    //{ title: 'Welcome party!', id: 2 },
    //{ title: 'Web dev top tips', id: 3 }
  ])

  const handlePrediction = () => {
    const newPrediction = {title: "Collecting weather data for location", id: 1};
    setPrediction(prediction => [prediction[0], prediction[1],newPrediction1]);
    const newPrediction1 = {title: "Pre-processing weather data", id: 2};
    setPrediction(prediction => [prediction[0], prediction[1],newPrediction1]);
    const newPrediction2 = {title: "Using pre-trained convolutional neural network to analyze data", id: 3};
    setPrediction(prediction => [prediction[0], prediction[1], prediction[2],newPrediction2]);
    const newPrediction3 = {title: "Making final prediction for solar energy potential", id: 4};
    setPrediction(prediction => [prediction[0], prediction[1], prediction[2], prediction[3], newPrediction3]);

  }

  return (
    <div className="Preciction">
        <input type="text" name="Langitude" placeholder="Langitude" required></input>
        <br></br>
        <input type="text" name="Longitude" placeholder="Longitude" required></input>
        <br></br>
        <button type="submit" onclick="runMLModel()">RUN MODEL</button>
      <OutputList prediction={prediction} title="Prediction Steps" handlePrediction={handlePrediction} />
    </div>
  );
}

export default Prediction;
